// import logo from './logo.svg';
// import './App.css';
import Grid from '@mui/material/Grid';


function Parallel() {
    const chargerElements = [];
    let ab = 1;
    let i = 0;
    let z = 0;

    for (let j = 0; j < 52; j++) {
      z = j % 4;
      if (z === 3) {
        i++;
      }

      const element = (
        <div
          key={`charger${ab}`}
          id={`charger${ab}`}
          style={{
            backgroundColor: '#cbcbcb',
            color: 'white',
            textAlign: 'right',
            fontSize: '18px',
            position: 'absolute',
            width: '5%',
            borderRadius: 10,
            height: '25px',
            left: `${18 + z * 6}%`,
            top: `${2 + i * 8}%`,
          }}
        >
          {i % 2 === 0 ? (
            <>
              <div style={{ height: 10, width: '120%', margin: 'auto', backgroundColor: 'blue', marginTop: '42px' }}></div>
              <p style={{ marginTop: '-50px' }}>{ab}</p>
            </>
          ) : (
            <>{ab}</>
          )}
        </div>
      );

      chargerElements.push(element);
      ab++;
    }

    // Print the chargerElements array to the console to see the sequence of elements.
    console.log(chargerElements);

    return (
      <div className="App">
        <Grid container >
        <Grid  xs={8}>
  {chargerElements}
  </Grid>
  <Grid xs={4}></Grid>
  </Grid>

      </div>
    );
  }

  export default Parallel;
